['// Banner hates his enemies (like others don't). As we all know, he can barely
 // talk when he turns into the incredible Hulk. That's why he asked you to
 // help him to express his feelings.

 // Hulk likes the Inception so much, and like that his feelings are
 // complicated. They have n layers. The first layer is hate, second one is
 // love, third one is hate and so on...

 // For example if n = 1, then his feeling is "I hate it" or if n = 2 it's "I
 // hate that I love it", and if n = 3 it's "I hate that I love that I hate it"
 // and so on.

 // Please help Dr. Banner.

 // Input 
 // The only line of the input contains a single integer n (1 ≤ n ≤ 100) — the
 // number of layers of love and hate.

 // Output 
 // Print Dr.Banner's feeling in one line.

#include <stdio.h>

int main(void) {

    int number;
    if (scanf("%d", &number) != 1) {
        return 1; 
    }

    int i = 0;
    while (i < number) {
        printf("I ");
        if (i % 2 != 0) {
            printf("love ");
        } else {
            printf("hate "); 
        }

        if (i == number - 1) {
            // For the last one.
            printf("it\n");
        } else {
            printf("that ");
        }
        i++;
    }

    return 0;
}
