['#include <stdio.h>
#include <assert.h>

#define LOVE 1
#define HATE 0

int layerType(int n)
{
    return ((n % 2 == 0) ? LOVE : HATE);
}

int main()
{
    int numOfLayers, n;
    scanf("%d", &numOfLayers);
    assert(numOfLayers >= 1 && numOfLayers <= 100);
    
    char *sep = "";
    n= 1;
    while(n <= numOfLayers) {
        sep = (n == numOfLayers) ? "it" : "that ";
        
        if(layerType(n) == LOVE)
            printf("I love %s", sep);
        else if(layerType(n) == HATE)
            printf("I hate %s", sep);
        
        n++;
    }
    
    putchar('\n');
}']

